import React, { Component } from 'react';
import {
    Link
} from "react-router-dom";

export class Nav extends Component {
    render() {
        return (
            <div>

<nav>
        <ul>
          <li>
            <Link to="/start">Start</Link>
          </li>
          <li>
            <Link to="/forecast">Forecast</Link>
          </li>
          <li>
            <Link to="/advice">advice</Link>
          </li>
          <li>
            <Link to="/forecast">Forecast</Link>
          </li>
        </ul>
      </nav>


            </div>
        );
    }
}

export default Nav;
